Katie St.Ives, Alexis Texas, Jada Stevens, Lexi Belle, Jessica Jaymes


Katie and her office boyfriend always take a break together. But this time the boss decides to break Katie in. Alexis is one tough boss who catches her employee planning a party, so she makes him stay for a private party of their own. Jada has a secret crush and decides to confide in the company HR guy. He can't allow any office romance until he's getting some first. Jessica knows all about motivating her salesmen, and one lucky salesman gets to know all about Jessica's pervy methods. Lexi and her co-worker can't agree on anything in front of their boss, so when the boss leaves, they agree to get it on.
